import logo from './logo.svg';
import './App.css';
import Main from './components/Main';
import NavBar from './components/NavBar';

function App() {
  return (
    <div className='container'>
      <NavBar />
      <Main />
      <img>logo</img>
    </div>
  );
}

export default App;
